      // const arr = res.data.concat(projectName)
      // setData(arr);
      console.log(res);

      console.log(res.data.type);
      setData(res.data);
      console.log(data);
    });
  }, []);

  return (
    <>
    <div style={{display:"grid", gridTemplateColumns: "1fr 1fr 1fr", ga}}> 
      {data.map((elem) => {
        return (
          <DisplayProjects 
            url={elem.img}
            leader={elem.leader}
            date={elem.date}
            name={elem.name}
            type={elem.type}
            desc={elem.desc}
            team={elem.teamNeeded}
            level={elem.level}
            location={elem.location}
          />
        );
      })}
      </div>
    </>
  );
}
